import React from 'react';

import Button from '../../UserInterface/Buttons/Button/Button';

function WarningPasswordNotConfimed(props) {

    return (
        <div className={props.classname}>
            <h2>Введенный пароль не подтвержден</h2>
            <h2>Введите правильный пароль или обратитесь за помощью к администратору</h2>
            <Button
                onclick={props.onclick}
                icon="fa fa-sign-in"
                name = 'Повторить'
            />
        </div>

    )
}

export default WarningPasswordNotConfimed
